define({"topics" : [{"title":"Execution with no variation-related parameters","shortdesc":"\n                     <p class=\"shortdesc\">If, at the start of execution, both fields (<span class=\"ph uicontrol\">Keyword</span> and    <span class=\"ph uicontrol\">AUT Version</span>) of the <span class=\"keyword wintitle\">Variation Specification</span> section   are left blank, then the <span class=\"keyword\">default variation</span> of an invoked test module, action,   interface, or data set constitutes an exact match, and is invoked.\n                     </p>\n                  ","id":"variations_rules_executing_2_1","href":"TA_Help\/Topics\/Variations_rules_executing_2_1.html","menu": {"hasChildren":false,},"tocID":"variations_rules_executing_2_1-d46e26353","topics":[]},{"title":"Execution with keywords only","shortdesc":"\n                     <p class=\"shortdesc\"> When a test is launched with keywords specified, <span class=\"ph\"></span> applies a set of\n                        rules to determine the appropriate variations to use. \n                     </p>\n                  ","id":"variations_rules_executing_2_2","href":"TA_Help\/Topics\/Variations_rules_executing_2_2.html","menu": {"hasChildren":false,},"tocID":"variations_rules_executing_2_2-d46e26376","topics":[]},{"title":"Execution with only version nodes","shortdesc":"\n                     <p class=\"shortdesc\">In this scenario, the runtime variation specification contains no keywords, but one or     more system\/version nodes are provided\n                        (that is, there is a version run set). \n                     </p>\n                  ","id":"variations_rules_executing_2_3","href":"TA_Help\/Topics\/Variations_rules_executing_2_3.html","menu": {"hasChildren":false,},"tocID":"variations_rules_executing_2_3-d46e26389","topics":[]},{"title":"Execution with both keywords and version nodes","shortdesc":"\n                     <p class=\"shortdesc\">When the <span class=\"keyword wintitle\">Execute Test</span> dialog box&apos;s runtime variation specification     includes both keywords and version nodes, the decision-making performed\n                        is largely a combination     of those described in the previous two cases.\n                     </p>\n                  ","id":"variations_rules_executing_2_4","href":"TA_Help\/Topics\/Variations_rules_executing_2_4.html","menu": {"hasChildren":false,},"tocID":"variations_rules_executing_2_4-d46e26400","topics":[]}]});